import React from 'react';
import { Card,Button,CardGroup } from 'react-bootstrap';
import members from '../Data/membersData';

const MemberItem = ({member}) => {

  return (
    <div> 
        <CardGroup>
         <Card border={( member.membership==="gold" )? "gold": ( member.membership==="silver" )? "silver" :
        ( member.membership==="platinum" )? "orange" :""} >
            <Card.Header>
                {/* {(mem)} */}
            </Card.Header>
             <Card.Body>
                 <Card.Title>{`${member.firstName} ${member.lastName}`}</Card.Title>
                 <Card.Text>{`Borrowed Item: ${member.currentlyBorrowedBooks}`}</Card.Text>
                 <Button variant="primary">Update</Button>
             </Card.Body>
        </Card>
        </CardGroup>
    </div>
    );
};

export default MemberItem;
